import React from 'react';
import './'; // Importe seu arquivo SASS

function Menu() {
  return (
    <div className="menu">
      <ul>
        <li>
          <a href="#">Página Inicial</a>
        </li>
        <li>
          <a href="#">Sobre</a>
        </li>
        <li>
          <a href="#">Serviços</a>
        </li>
        <li>
          <a href="#">Contato</a>
        </li>
      </ul>
    </div>
  );
}

export default Menu;
